    data: |
      SELECT DISTINCT + 84 + 48, col0 FROM tab1 (FORMAT parquet) WHERE + + col0 * ( col2 ) * + + col0 * + + ( + + col0 ) <> col0 * + col2;
  - name: tab1

outputs:
  - name: q5599.out
    data: |
      132	51
      132	85
      132	91
